import React from "react";
import "./style.css";

const TopButtonInProgress = props => {
  return (
    <div id="centerDiv">
      <div>
        <a href="inprogress">
          <button className="topButtonInProgress">Top</button>
        </a>
      </div>
    </div>
  );
};

export default TopButtonInProgress;
